
def lengthOfLongestSubstring1(s):
    """
    :type s: str
    :rtype: int
    """
    longest_s = ''
    if len(s) == 1 or len(s) == 0:
        return s

    for index in range(len(longest_s), len(s)):
        for index2 in range(index + 1, len(s)+1):
            candidate = s[index:index2]
            if len(candidate) != len(set(candidate)):
                break
            if len(candidate) > len(longest_s):
                longest_s = candidate
    return longest_s

def lengthOfLongestSubstring(s):
    """
    :type s: str
    :rtype: int
    """
    s_len = len(s)
    if s_len == 1 or s_len == 0:
        return s

    longest_s = ''
    longest_length = len(set(s))
    found = False
    for longest_s_len in reversed(range(longest_length+1)):
        for index in range(s_len):
            if len(longest_s) == longest_s_len:
                found = True
                break
            candidate = s[index:(index+longest_s_len)]
            if len(set(candidate)) == len(candidate):
                longest_s = candidate
        if found:
            break
        longest_s_len -= 1
    return longest_s

